import sheltersService from '../../services/shelter-service';
import { Component } from 'react';


class SheltersList extends Component {
    
    state = {
        shelters: [],
        loading: true
    }

    componentDidMount() {
        sheltersService.list()
            .then(shelters => this.setState({
                shelters,
                loading: false
            }))
            .catch(error => console.error(error));
    }

    render() {
        const { shelters } = this.state;

        if(this.state.loading) {
            return <div>
                <div class="paw-print-1">
                    <div class="pad large"></div>
                    <div class="pad small-1"></div>
                    <div class="pad small-2"></div>
                    <div class="pad small-3"></div>
                    <div class="pad small-4"></div>
                </div>
    
                <div class="paw-print-2">
                    <div class="pad large"></div>
                    <div class="pad small-1"></div>
                    <div class="pad small-2"></div>
                    <div class="pad small-3"></div>
                    <div class="pad small-4"></div>
                </div>    
    
<div class="paw-print-3">
    <div class="pad large"></div>
    <div class="pad small-1"></div>
    <div class="pad small-2"></div>
    <div class="pad small-3"></div>
    <div class="pad small-4"></div>
</div>
            </div>
        }

        return (
            <div>
                {shelters.map(shelter => (
                    <div key={shelter.id}>{shelter.name}</div>
                ))}
            </div>
        );
    }
}







export default SheltersList;
